package ar.lamansys.sgh.clinichistory.application.anestheticreport.chart.document;

import com.lowagie.text.DocumentException;
import java.io.FileOutputStream;
import java.io.IOException;
import org.junit.jupiter.api.Disabled;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.Timeout;
import org.xhtmlrenderer.pdf.ITextRenderer;

import static org.assertj.core.api.Fail.fail;

class CreateAnestheticChartPDFTest {

    String templateName = "report_with_image";

    String outputFilePath = "src/test/resources/templates/anestheticreport";


    String getSomeHTML() {
        return "<html lang=\"es\">\n" +
                "<head>\n" +
                "    <title>Report</title>\n" +
                "    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\"/>\n" +
                "    <style>\n" +
                "        img {\n" +
                "            max-width: 100%;\n" +
                "            height: auto;\n" +
                "            display: block;\n" +
                "            margin: auto;\n" +
                "        }\n" +
                "        .img-container {\n" +
                "            width: 700px;\n" +
                "            height: 420px;\n" +
                "            overflow: hidden;\n" +
                "        }\n" +
                "    </style>\n" +
                "</head>\n" +
                "<body>\n" +
                "<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam ornare velit quis nulla sagittis, sit amet viverra purus commodo. Donec id \n" +
                "magna id enim feugiat dictum sit amet non felis. Cras vehicula neque ut enim accumsan, non fermentum odio accumsan. Integer eget \n" +
                "tortor at eros sodales fringilla. Duis feugiat odio sit amet dui dapibus, nec condimentum neque volutpat. Mauris nec urna sed justo aliquet \n" +
                "auctor. Sed eget justo id lorem efficitur faucibus. Nullam quis nisi ac est tincidunt facilisis.</p>\n" +
                "<br/>\n" +
                "<div class=\"img-container\">\n" +
                "    <img src=\"data:image/png;base64,\"" +
                " alt=\"img!\" />" +
                "</div>" +
                "<br/>\n" +
                "</body>\n" +
                "<footer class=\"footer-dark\">\n" +
                "    footer\n" +
                "</footer>\n" +
                "</html>"
                ;
    }

    void createPDF(String htmlContent) {
        String output = String.format("%s/%s.pdf", outputFilePath, templateName);
        ITextRenderer renderer = new ITextRenderer();

        renderer.setDocumentFromString(htmlContent);
        renderer.layout();

        this.savePDFToFile(renderer, output);

    }

    void savePDFToFile(ITextRenderer renderer, String filePath) {
        try (FileOutputStream fos = new FileOutputStream(filePath)) {
            renderer.createPDF(fos, false);
            renderer.finishPDF();
        } catch (IOException | DocumentException e) {
            fail("Failed to save PDF: " + filePath);
        }
    }

    @Disabled("Test to manually review the result")
    @DisplayName("Test pdf with chart")
    @Test
    @Timeout(3)
    void generate() {

        // Arrange
        String html = this.getSomeHTML();

        // Act & Assert
        this.createPDF(html);
    }
}
